ul.script:
/**
 * Turns off the default div within blog-card if another div with the language of the user
 * exists.
 * @param {HTMLElement} element Element to look through for the language divs.
 */
function blogPostCSSLanguageToggle(element) {
  if (!element) {
    return;
  }
  var langPosts = element.getElementsByClassName('lang_post');
  var defaultElem = null;
  var hasABlogPostInTheirLanguage = false;
  for (var i = 0; i < langPosts.length; i++) {
    var elem = langPosts[i];
    if (elem.classList.contains('default')) {
      defaultElem = elem;
    } else if (elem.lang == 'en') {
      hasABlogPostInTheirLanguage = true;
    }
  }
  if (hasABlogPostInTheirLanguage && defaultElem) {
    defaultElem.style.display = 'none';
  }
}
blogPostCSSLanguageToggle(document.getElementById('blog-card'));
